import React from 'react';
import styled from 'styled-components';

const RibbonHolder = styled.div`
  width: 100px;
  height: 100px;
  background: red;
  position: relative;
  top: -5px;
  right: -5px;
`;

const RibbonBody = styled.span`
  width: 200px;
  padding: 15px 0px;
  background: blue;
  display: block;
  position: relative;
  top: 20px;
  left: -25px;
  transform: rotate(45deg);
`;

const Ribbon = () => {
  return (
    <RibbonHolder>
      <RibbonBody>sdfa</RibbonBody>
    </RibbonHolder>
  );
};

export default Ribbon;
